Register Route not working in JWT Implementation ExpressJS<p>Working on an authentication scheme for an app, and I'm implementing JWT from scratch. I've confirmed I can login as a user that is already registered in the DB (mongo) and I'm trying to code up a registration route.</p>

<p>here is my <code>/register</code> route:</p>

<pre><code>app.post('/register', (req, res) =&gt; {
    log.info('Checking password')
    if (req.body.password !== req.body.password2) {
        res.status(500).send({ success: false, message: "Passwords do not match" });
    } else {
        log.info('password verification successful');
    }
    //Parse the user from the body.
    bcrypt.genSalt(10, (err, salt) =&gt; {
        bcrypt.hash(req.body.password, salt, (err, hash) =&gt; {
            let u = new User({
                firstName: req.body.firstName,
                lastName: req.body.lastName,
                username: req.body.userName,
                password: hash,
                registeredApps: []
            });
            log.info(u.toString());
            u.save((err) =&gt; {
                if (err) {
                    log.error('error saving user to database.');
                    log.error(err);
                    res.status(400).send(err);
                } else {
                    log.info('user successfully saved.');
                    res.status(200).send({ success: true });
                }
            });
        });
    });
});
</code></pre>

<p>I can confirm that my user object does get to the route, but it appears that nothing in the <code>u.save()</code> method. Nothing happens, and the user is not being saved to the database.</p>

