Meteor mongo find() UnhandledPromiseRejectionWarning, maximum call stack size exceeded<p>I'm having a strange error while doing a mongodb find in my meteor app. The error being shown in the console is:</p>

<pre><code>(node:20388) UnhandledPromiseRejectionWarning: Unhandled promise rejection (rejection id: 2):
RangeError: Maximum call stack size exceeded
</code></pre>

<p>I've googled and found a couple of similar instances, but my circumstances are different and not tied to data size -- it's a very simple query and happens no matter what the query contents are.</p>

<p>On the client side, I do this:</p>

<pre><code>Meteor.call( 'Things.search', searchString,(error,result) =&gt; {
      if(error){
        console.log(error);
      } else {
        console.log("Got result");
        ...
</code></pre>

<p>and it returns instantly from the server side with no error and result 
is undefined rather than being a cursor. The server side does this:</p>

<pre><code>Meteor.methods({
  'Things.search'( searchString ) {
    check(searchString, String);
    process.on('unhandledRejection', r =&gt; console.log(r));
    try {
      let searchOptions = "$i";
      let result = Things.find({
        $or:[
          {typeOfThing:{ $regex: searchString, $options: searchOptions }},
          {name:{ $regex: searchString, $options: searchOptions }}]
        });
      return result;
    } catch (exception) {
      console.log( exception );
      throw new Meteor.Error('500', exception);
    }
  },
});
</code></pre>

<p>On a suggestion in another forum, I added the process.on() to reveal more about the underlying unhandled promise. After adding that, the console also showed this additional info:</p>

<pre><code>RangeError: Maximum call stack size exceeded
I20180202-20:38:14.522(-5)?     at Object.keys.forEach.key (packages/ejson/ejson.js:594:27)
I20180202-20:38:14.522(-5)?     at Array.forEach (&lt;anonymous&gt;)
I20180202-20:38:14.525(-5)?     at Object.EJSON.clone.v [as clone] (packages/ejson/ejson.js:594:18)
I20180202-20:38:14.527(-5)?     at Object.keys.forEach.key (packages/ejson/ejson.js:595:22)
I20180202-20:38:14.528(-5)?     at Array.forEach (&lt;anonymous&gt;)
I20180202-20:38:14.530(-5)?     at Object.EJSON.clone.v [as clone] (packages/ejson/ejson.js:594:18)
I20180202-20:38:14.549(-5)?     at Object.keys.forEach.key (packages/ejson/ejson.js:595:22)
I20180202-20:38:14.551(-5)?     at Array.forEach (&lt;anonymous&gt;)
I20180202-20:38:14.553(-5)?     at Object.EJSON.clone.v [as clone] (packages/ejson/ejson.js:594:18)
I20180202-20:38:14.554(-5)?     at Object.keys.forEach.key (packages/ejson/ejson.js:595:22)
</code></pre>

<p>Using the chrome server debugger with meteor 1.6, I confirmed that there is an infinite loop in ejson.js.</p>

<p>Seems like a bug that's not mine -- I doubt find() should just go into an infinite loop. Does anyone have an idea about this?</p>

