NestJS cannot verify argument is available in current context/Mongoose Inject Model<p>I followed the MongoDB tutorial on the nestjs website but am unable to replicate it in my own project, I have cloned the nextjs repo and verified that the mongo sample supplied there runs fine.</p>

<p>This is what I currently have (minified):</p>

<p>app.module.ts</p>

<pre><code>@Module({
  imports: [
    MongooseModule.forRoot('mongodb://localhost/nest')
  ],
  modules: [
    CampaignModule
  ]
})
export class AppModule implements NestModule {}
}
</code></pre>

<p>campaign.module.ts</p>

<pre><code>@Module(
  {
    modules: [SharedModule],
    controllers: [CampaignController],
    components: [CampaignService],
    imports: [MongooseModule.forFeature([{name: 'Campaign', schema: campaignSchema}])]
  })
export class CampaignModule {}
</code></pre>

<p>campaign.service.ts</p>

<pre><code>@Component()
export class CampaignService {
  constructor(@InjectModel(campaignSchema) private readonly campaignModel: Model&lt;CampaignInterface&gt;) {}
}
</code></pre>

<p>this builds fine as expected but when I run it i get this error:</p>

<pre><code>Nest can't resolve dependencies of the CampaignService (?). Please verify whether [0] argument is available in the current context.
</code></pre>

<p>So because in my app.module.ts I have the campaign module in the modules section (how i have had it so far working fine prior to mongodb) I moved it into the imports sections with the MongooseModule now it will build and run fine, but the routes inside the controller for campaign.controller.ts do not register at all, they just return 404's. This is weird because the example in the nestjs repo have the CatsModule inside the imports with the MongooseModule and it works.</p>

<p>Any tips here would be appreciated. this is my schema and interface for the campaign object as well:</p>

<pre><code>export interface CampaignInterface extends Document, Campaign {
}

export const campaignSchema: any = new mongoose.Schema({
  campaignId: String
});
</code></pre>

<p><strong>EDIT 1</strong>
I moved all my modules into the import section of my app.module.ts file as before I tried it with CampaignModule in imports and all the others in modules: []. It now fails right away when served with the same error and no routes are registered.</p>

