MongoDB Aggregration - $match inside of nested Schema as array?<p>I would like to use $sum operation inside an aggregate operation of mongoDB. However, there is a field inside the nested Schema which is a also array I have to check.</p>

<p>This is my top schema Cart : </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const CartSchema = new Schema({
    created_at: { type: Date, default: moment() },
    updated_at: { type: Date, default: moment(), expires: 300 },
    cartitems: [{ type : Schema.Types.ObjectId, ref : 'cartitem'}],
    user: {
        type: Schema.Types.ObjectId,
        ref: 'user'
    },
});</code></pre>
</div>
</div>
</p>

<p>And this is the CartItemSchema :</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const CartItemSchema = new Schema({
    cart : {
        type : Schema.Types.ObjectId,
        ref : 'cart'
    },
    product : {
        type : Schema.Types.ObjectId,
        ref : 'product'
    },
    created_at : { type : Date, default : moment() },
    quantity : Number
});</code></pre>
</div>
</div>
</p>

<p>And this is my aggregation function : </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>CartSchema.statics.findStockFromCarts = function (productId) {

    return this.aggregate([
        { $unwind : "$cartitems" },
        { $match : { "cartitems" : { "product" :{  "$oid" : productId } } }},
        {
            $group: {   
                "_id" : "$oid",
                total: {
                    $sum: "cartitems.quantity",                    
                }
            }
        }
    ])

}</code></pre>
</div>
</div>
</p>

<p>The actual behavior is that it returns an empty array.</p>

<p>The expected behavior is that it has to return total quantity of the products who are in those carts.</p>

<p>Result from the mLab : </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>{
    "_id": {
        "$oid": "5a7a2ac99f12ff0874be3e0c"
    },
    "created_at": {
        "$date": "2018-02-06T22:22:47.913Z"
    },
    "updated_at": {
        "$date": "2018-02-06T22:23:05.779Z"
    },
    "cartitems": [
        {
            "created_at": {
                "$date": "2018-02-06T22:22:47.915Z"
            },
            "_id": {
                "$oid": "5a7a2aca9f12ff0874be3e0d"
            },
            "quantity": 1,
            "product": {
                "$oid": "5a76449c852bcd2427911fba"
            }
        }
    ],
    "__v": 1
}</code></pre>
</div>
</div>
</p>

<p>The query for creating this document !</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>CartSchema.statics.addItem = function (cartId, productId, quantity) {
    console.log("CartSchema addItem : cartId : " + cartId);
    console.log("CartSchema addItem : item : " + productId);
    console.log("CartSchema addItem : quantity : " + quantity);
    const CartItem = mongoose.model('cartitem');
    return this.findById(cartId)
        .then(cart =&gt; {
            const cartitem = new CartItem({ quantity });
            cartitem.product = productId;
            console.log("CartSchema addItem : cartItem : " + cartitem);
            console.log("CartSchema addItem : cartItem.id " + cartitem.id)
            cart.cartitems.push(cartitem);
            console.log("CartSchema addItem : cart total : " + cart)
            return Promise.all([
                cart.save()
            ]).then(([cart]) =&gt; cart);
        })
};</code></pre>
</div>
</div>
</p>

